func TestParseKeyRate(t *testing.T) {
	kr, err := cbr.ParseKeyRate([]byte(testData))
	if err != nil {
		t.Errorf("ParseKeyRate() unexpected error = %v", err)
		return
	}

	want := 21.

	if kr.Val != want {
		t.Errorf("ParseKeyRate() val = %v, want %v", kr.Val, want)
	}

	expDate := time.Date(2024, time.October, 28, 0, 0, 0, 0, time.UTC)
	if !kr.Date.Equal(expDate) {
		t.Errorf("ParseKeyRate() date = %v, want %v", kr.Date, expDate)
	}
}

func TestCurrentKeyRate(t *testing.T) {
	kr, err := cbr.CurrentKeyRate()
	if err != nil {
		t.Errorf("CurrentKeyRate() unexpected error = %v", err)
		return
	}

	if kr.Val == 0 {
		t.Errorf("CurrentKeyRate() val = 0")
	}
}
